import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import store from './redux/state/state';
let RenderFunc = () => {
    ReactDOM.render(
      <React.StrictMode>
        <App state={getState} addPost={store.addPost} UpdatePost={store.UpdatePost}/>
      </React.StrictMode>,
      document.getElementById('root')
    );
  }
RenderFunc(store._state);
store.subscrybe(RenderFunc);

